import React from 'react';
import PropTypes from 'prop-types';
import classNames from 'classnames';
import { SectionProps } from '../../utils/SectionProps';
import Input from '../elements/Input';
import Image from "../elements/Image";

const propTypes = {
  ...SectionProps.types,
  split: PropTypes.bool
}

const defaultProps = {
  ...SectionProps.defaults,
  split: false
}

const Cta = ({
  className,
  topOuterDivider,
  bottomOuterDivider,
  topDivider,
  bottomDivider,
  hasBgColor,
  invertColor,
  split,
  ...props
}) => {

  const outerClasses = classNames(
    'cta section center-content-mobile reveal-from-bottom',
    topOuterDivider && 'has-top-divider',
    bottomOuterDivider && 'has-bottom-divider',
    hasBgColor && 'has-bg-color',
    invertColor && 'invert-color',
    className
  );

  const innerClasses = classNames(
    'cta-inner section-inner',
    topDivider && 'has-top-divider',
    bottomDivider && 'has-bottom-divider',
    split && 'cta-split'
  );

  return (
    <section
      {...props}
      className={outerClasses}
    >
      <div className="">
          <div id="nous_contacter" className="nous-contacter">
            <h2 id="nos_parternaires" className="mt-32 pt-32 container-sm reveal-from-bottom center-content" data-reveal-delay="200">
              Nous contacter
            </h2>
          </div>
        <div
          className={innerClasses}
        >
          <div className="cta-slogan">
            <Image
               src={require('./../../assets/images/map.png')}
               alt="Features tile icon 05"
               width={64}
               height={64} />
          </div>
          <div className="cta-action testimonial-item-content tiles-item-inner">
            {/*<Input id="newsletter" type="email" label="Subscribe" labelHidden hasIcon="right" placeholder="Your best email">*/}
            {/*  <svg width="16" height="12" xmlns="http://www.w3.org/2000/svg">*/}
            {/*    <path d="M9 5H1c-.6 0-1 .4-1 1s.4 1 1 1h8v5l7-6-7-6v5z" fill="#376DF9" />*/}
            {/*  </svg>*/}
            {/*</Input>*/}
              <form action="submit_form.php" method="post">
                <input type="text" id="nom" placeholder="Nom" name="nom" /><br/><br/>
                  <input type="text" id="telephone" placeholder="Téléphone" name="telephone"/><br/><br/>
                  <input type="email" id="mail" placeholder="Email" name="mail" /><br/><br/>
                  <textarea id="message" placeholder="Message" name="message" /><br/><br/>
                  <input type="submit" value="Envoyer" />
              </form>
          </div>
        </div>
      </div>
    </section>
  );
}

Cta.propTypes = propTypes;
Cta.defaultProps = defaultProps;

export default Cta;
